import React from 'react'

export  function Button({buttonText, req, setReq}) {
  return (
    <button
     className={buttonText === req ? 'selected': null}
     type = 'button'
     onClick={()=> setReq(buttonText)}
    >
        {buttonText}

    </button>

  )
}

export default Button;
